import React from 'react'; // we need this to make JSX compile
import CounterDisplay from './CounterDisplay';
import CounterChanger from './CounterChanger';
import './CDE.css';


interface CDEProps {
  title?: string;
  paragraph?: string;
}

class CDECard extends React.Component<CDEProps> {
    render() {
        return (
            <section>
                <h2>CDE Name</h2>
                <p>
                    Gender Identity
                </p>
                <h2> Specification</h2>
                <p>
                    1a. What terms best express how you describe your gender identity? (Check all that apply)
                </p>
                <p className="list">
                    Man<br />
                    Woman<br />
                    Non-binary<br />
                    Transgender<br />
                    None of these describe me, and I’d like to consider additional options<br />
                    Prefer not to answer<br />
                </p>
                <h2>Collection</h2>
                <p>Self-Report</p>

                <h2>Source</h2>
                <p>RADx [All of Us Research Program PPI]</p>

                <h2>Definition</h2>
                <p>
                    NCIt and CDISC:  Gender Identity (Code C158277) – Definition:  A person's internally 
                    held sense of their gender, which may or may not correspond to the individual's genotypic or phenotypic sex.
                </p>
                <div className="voteCount">
                {/* This calls the voting component */}
                <CounterDisplay /><CounterChanger />
                </div>
            </section>
        )
    };
}

export default CDECard;
